import React, { Component } from 'react'
import PropTypes from 'prop-types';

class TutorialModel extends Component {
    render() {
        const {article} = this.props
        return (
            <>
                <div className='text-left'>
                    <p className='poppins-700 text-18 bg'>{article.fields.title}</p>
                    <p className='lato gray1 leading-7 letterspacing-1'>{article.fields.description}</p>
                </div>
            </>
        )
    }
}

TutorialModel.propTypes = {
    article: PropTypes.object
}

export default TutorialModel
